import React from "react";
import "./Faqs.css";

const Faqs = () => {
  return (
    <>
      <div className="faqs">
        <div className="container">
          <div className="faqs-title">
            <p>Faqs</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Faqs;
